/* eslint-disable no-empty-function, no-restricted-syntax */
'use strict';

var getPrototypeOf = require( './../lib' );

var proto;

proto = getPrototypeOf( 'beep' );
console.log( proto );
// => String.prototype

proto = getPrototypeOf( 5 );
console.log( proto );
// => Number.prototype

proto = getPrototypeOf( true );
console.log( proto );
// => Boolean.prototype

proto = getPrototypeOf( null );
console.log( proto );
// => null

proto = getPrototypeOf( void 0 );
console.log( proto );
// => null

proto = getPrototypeOf( [] );
console.log( proto );
// => Array.prototype

proto = getPrototypeOf( {} );
console.log( proto );
// => {}

proto = getPrototypeOf( function foo() {} );
console.log( proto );
// => Function.prototype
